import './App.css';
import Navbar from './components/Navbar'
import Home from './components/Home'
import AboutView from './components/AboutView'
import {Routes,Route} from 'react-router-dom'


function App() {
  return (
    <div>
      <Navbar />
      <Routes>
       <Route path="/" >
          <Home />
        </Route> 
        <Route path="/about" element={AboutView} />
      {/* <AboutView /> */}
      </Routes>
    </div>
  );
}

export default App;
